import React from 'react'
import {Jumbotron} from 'reactstrap'

function Home(){
    return(
        <div>
            <Jumbotron>
                <h1>Hello World</h1>
                <p>This is a home page of our first application.<br/>It is a jumbotron component. I wonder why br is not working here.! </p>
            </Jumbotron>
        </div>
    );
}

export default Home;
